(function () {
    'use strict';

    define([], function () {

        PhotoService.$inject = [];

        function PhotoService() {
        	this.getPicture = function() {
				var dfd = $.Deferred();
                
                //dfd.resolve('')
                //return dfd.promise();
                
                try {
                    var device = require('device');
                    device.getPicture(function(imageData) {
                        dfd.resolve(imageData);
                    }, function(err) {
                        console.error('[PhotoService] - Error on getPicture: ' + err);
                        dfd.reject();
                    }, { 
                        quality: 50,
                        destinationType: 0,//Camera.DestinationType.DATA_URL, // Camera does not exist on Rho, so use constant
                        outputFormat: 'dataUri'
                    })
                } catch (e) {
                    console.error('Error on takeDeviationPhoto: ' + e);
                    dfd.reject();
                }
                
                return dfd.promise();
			};
        }
        return PhotoService;
    });
})();